import React from 'react';
import '../CSS/Homepage.css'
import Header from './Components/Header';

const Homepage = ({ loadHeader }) => {
  return (
    <React.Fragment>
      {loadHeader && <Header />}
      <main>Homepage</main>
    </React.Fragment>
  );
};

export default Homepage;
